{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/hosseintimasi/bellabeat-data-analyze-with-r?scriptVersionId=161899374\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"d65f6aa2","metadata":{"papermill":{"duration":0.011744,"end_time":"2024-02-06T10:04:15.47424","exception":false,"start_time":"2024-02-06T10:04:15.462496","status":"completed"},"tags":[]},"source":["![](https://miro.medium.com/v2/resize:fit:1400/1*SjEGKrjDp7skk4URhzW5Nw.png)\n","\n","# Case Study: How Can a Wellness Technology Company Play It Smart?\n","\n","## Introduction\n","\n","Welcome to the Bellabeat data analysis case study! In this case study, I will perform many real-world tasks as a data analyst by Bellabeat, a high-tech manufacturer of health-focused products for women.\n","\n","## Scenario\n","\n","Bellabeat is a successful small company, but they have the potential to become a larger player in the\n","global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart\n","device fitness data could help unlock new growth opportunities for the company. I have been asked to focus on one of\n","Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The\n","insights I discover will then help guide marketing strategy for the company.\n","\n","## Characters and products\n","* Characters\n","    * Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","    * Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","    * Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.\n","* Products\n","    * Bellabeat app: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","    * Leaf: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","    * Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","    * Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","    * Bellabeat membership: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","    \n","## About the company\n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products.\n","Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around\n","the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with\n","knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned\n","itself as a tech-driven wellness company for women.\n","\n","By 2016, Bellabeat had opened offices around the world and launched multiple products. Bellabeat products became available\n","through a growing number of online retailers in addition to their own e-commerce channel on [their website](https://bellabeat.com/). The company has\n","invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital\n","marketing extensively. Bellabeat invests year-round in Google Search, maintaining active Facebook and Instagram pages, and\n","consistently engages consumers on Twitter. Additionally, Bellabeat runs video ads on Youtube and display ads on the Google\n","Display Network to support campaigns around key marketing dates.\n","\n","Sršen knows that an analysis of Bellabeat’s available consumer data would reveal more opportunities for growth. She has\n","asked the marketing analytics team to focus on a Bellabeat product and analyze smart device usage data in order to gain\n","insight into how people are already using their smart devices. Then, using this information, she would like high-level\n","recommendations for how these trends can inform Bellabeat marketing strategy.\n","\n","## Ask\n","Sršen asks me to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart\n","devices. She then wants me to select one Bellabeat product to apply these insights to in my presentation. These questions\n","will guide my analysis:\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n","I will produce a report with the following deliverables:\n","1. A clear summary of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of my analysis\n","5. Supporting visualizations and key findings\n","6. My top high-level content recommendations based on my analysis\n","\n","## Prepare\n","Sršen encourages me to use public data that explores smart device users’ daily habits. She points me to a specific data set:\n","* [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) (CC0: Public Domain, dataset made available through [Mobius](https://www.kaggle.com/arashnic): This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n","Sršen tells me that this data set might have some limitations, and encourages me to consider adding another data to help\n","address those limitations as you begin to work more with this data.\n","\n","## Process\n","In order to process the dataset for analysis I will use the following Case Study Roadmap as a guide:\n","##### Case Study Roadmap - Process\n","Guiding questions\n","* What tools am I choosing and why?\n","* Have I ensured the data’s integrity?\n","* What steps have I taken to ensure that the data is clean?\n","* How can I verify that the data is clean and ready to analyze?\n","* Have I documented the cleaning process so I can review and share those results?\n","\n","Key tasks\n","1. Check the data for errors.\n","2. Choose my tools.\n","3. Transform the data so I can work with it effectively.\n","4. Document the cleaning process.\n","\n"]},{"cell_type":"markdown","id":"d41ae264","metadata":{"papermill":{"duration":0.010915,"end_time":"2024-02-06T10:04:15.496234","exception":false,"start_time":"2024-02-06T10:04:15.485319","status":"completed"},"tags":[]},"source":["### Step 1, Installing Packages and loading libraries:"]},{"cell_type":"code","execution_count":1,"id":"c70cf81b","metadata":{"execution":{"iopub.execute_input":"2024-02-06T10:04:15.52214Z","iopub.status.busy":"2024-02-06T10:04:15.519915Z","iopub.status.idle":"2024-02-06T10:06:32.50582Z","shell.execute_reply":"2024-02-06T10:06:32.503199Z"},"papermill":{"duration":137.00249